define('text!markdown/webcomponent.html!export',[],function () { return {"vcard":{"header":"\n<h1 id=\"-ko-t-webcomponent-header-\">{{ko.t(&#39;webcomponent:Header&#39;)}}</h1>\n<p>{{ko.t(&#39;webcomponent:Summary&#39;)}}</p>\n<h3 id=\"-ko-t-webcomponent-vcard-\">{{ko.t(&#39;webcomponent:Vcard&#39;)}}</h3>\n<p>{{ko.t(&#39;webcomponent:VcardExample&#39;)}}\n","example":"</p>\n<h3 id=\"-ko-t-webcomponent-creation-\">{{ko.t(&#39;webcomponent:Creation&#39;)}}</h3>\n<p>{{ko.t(&#39;webcomponent:HtmlExample&#39;)}}</p>\n<pre><code class=\"lang-html\">&lt;ul class=&quot;vcard&quot;&gt;\n    &lt;li class=&quot;fn&quot;&gt;{{&#39;{{Name}}&#39;}}&lt;/li&gt;\n    &lt;li class=&quot;street-address&quot;&gt;{{&#39;{{Street}}&#39;}}&lt;/li&gt;\n    &lt;li class=&quot;locality&quot;&gt;{{&#39;{{City}}&#39;}}&lt;/li&gt;\n    &lt;li&gt;&lt;span class=&quot;state&quot;&gt;{{&#39;{{State}}&#39;}}&lt;/span&gt;, &lt;span class=&quot;zip&quot;&gt;{{&#39;{{Zip}}&#39;}}&lt;/span&gt;&lt;/li&gt;\n    &lt;li class=&quot;text-large&quot;&gt;\n        &lt;span class=&quot;fa-lg&quot;&gt;\n            &lt;a class=&quot;hvr-grow&quot; href=&quot;mailto:{{&#39;{{Email}}&#39;}}&quot;&gt;&lt;i class=&quot;fa fa-envelope&quot;&gt;&lt;/i&gt;&lt;/a&gt;\n            &lt;a class=&quot;hvr-grow&quot; href=&quot;{{&#39;{{Github}}&#39;}}&quot;&gt;&lt;i class=&quot;fa fa-lg fa-github&quot;&gt;&lt;/i&gt;&lt;/a&gt;\n            &lt;a class=&quot;hvr-grow&quot; href=&quot;{{&#39;{{Linkedin}}&#39;}}&quot;&gt;&lt;i class=&quot;fa fa-lg fa-linkedin&quot;&gt;&lt;/i&gt;&lt;/a&gt;\n            &lt;a class=&quot;hvr-grow&quot; href=&quot;{{&#39;{{Stackoverflow}}&#39;}}&quot;&gt;&lt;i class=&quot;fa fa-lg fa-stack-overflow&quot;&gt;&lt;/i&gt;&lt;/a&gt;\n        &lt;/span&gt;\n    &lt;/li&gt;\n&lt;/ul&gt;\n</code></pre>\n<p>{{ko.t(&#39;webcomponent:JavascriptExample&#39;)}}</p>\n<pre><code class=\"lang-javascript\">define([&#39;knockout&#39;,&#39;text!./vcard.html&#39;],function(ko,template){\n    return {\n        viewModel: function(params) {\n            if(params.viewModel)\n                ko.utils.extend(this,params.viewModel);\n            else\n                ko.utils.extend(this,params);\n        },\n        template:template\n    };\n});\n</code></pre>\n<h3 id=\"-ko-t-webcomponent-register-\">{{ko.t(&#39;webcomponent:Register&#39;)}}</h3>\n<p>{{ko.t(&#39;webcomponent:RegisterExample&#39;)}}</p>\n<pre><code class=\"lang-javascript\">define([&#39;knockout&#39;],function(ko){\n    ko.components.register(&#39;vcard&#39;, { require: &#39;components/vcard/vcard&#39; });\n});\n</code></pre>\n<h3 id=\"-ko-t-webcomponent-usage-\">{{ko.t(&#39;webcomponent:Usage&#39;)}}</h3>\n<p>{{ko.t(&#39;webcomponent:UsageExample&#39;)}}</p>\n<pre><code class=\"lang-html\">&lt;vcard params=&quot;viewModel:vcard&quot;&gt;&lt;/vcard&gt;\n</code></pre>\n<pre><code class=\"lang-javascript\">vm.vcard={\n    Name:&quot;John Rego&quot;,\n    Street:&quot;123 Main St&quot;,\n    City:&quot;Houston&quot;,\n    State:&quot;Texas&quot;,\n    Zip:&quot;77004&quot;,\n    Email:&quot;JRego@sharklasers.com&quot;,\n    Github:&quot;http://www.github.com/JRego&quot;,\n    Linkedin:&quot;http://www.linkedin.com/JRego&quot;,\n    Stackoverflow:&quot;http://www.stackoverflow.com/JRego&quot;\n};\n</code></pre>\n"}};});

